Meeting records and #DiamondLeaguge feels 🙌

@fastelaine clocks 10.65 - her ninth sub-10.80 of the season.

@kwarholm storms to 47.35, his 15th sub-47.50 – and the most in history.

@fkerley99 completes historic double, wins the 100m #DiamondTrophy - and becomes the first man in history to win 400m (2018) and 100m (2021) #DiamondLeague titles.

@kenny_bednarek extends sub-20 run to 11 in a single season.

@gianmarcotamberi and @mondo_duplantis add 💎 Trophy to Olympic 🥇 

@femke_bol completes unbeaten 2021 @diamondleagueathletics run.

@emmanuelkorir800m and @keely.hodgkinson back up #tokyo2020 form.

Germany gets javelin double thanks to @johannes_vetter and @christinhussong 💪

#wdlfinal #trackandfield #athletics

We don't deserve these photo finishes 😭

@faithkipyegon continues her sensational season to add the 1500m #DiamondLeague title in 3:58.33 to her Olympic gold.

@tim_cheruiyot turns the tables on @jakobing and wins his fourth 1500m #DiamondTrophy in 3:31.37. 

Benjamin Kigen takes the steeplechase crown back to Kenya and defeats Olympic champion @soufianeelbakkaliofficiel in 8:17.45.

